import React, { Component } from "react";

const UsersList = (props)=>{
      const {isunique,Userdata,gameplayed} = props
    return (

        <div className="table">
          <div className="heading">
            <p>First Name</p>
            <p>Last Name</p>
            <p>User Name</p>
            <p>Game</p>
          </div>
          { 
           (Userdata.map(user=>(
          <div className="userdata">
            <p>{user.fname}</p>
            <p>{user.lname}</p>
            <p>{user.username}</p>
            <p>{gameplayed}</p>

          </div>)))}



        </div>

    );
  }
export default UsersList
